INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<p>© 2015 TCT Skyline Int. All Rights Reserved. Build and Supported by <a href="http://www.yeaoh.com">Yeaoh Media Inc</a></p>', 'power by yeaoh', 'filtered_html'),
(2, '<p>Welcome to Skyline International. Staffed with industry professionals, we specialise in providing nationwide logistics solutions with client satisfaction in our heart.&nbsp;We appreciate the value of communication and transparency to our clients. The recently launched online freight tracking tool provides client the freight status up to date.</p>', 'welcome to skyline', 'filtered_html'),
(3, '<p style="color: #00A2CA;">Call Us</p>\r\n<div id="contact-info"><p>Phone: +61 433 428 778</p></div>\r\n<p style="color: #00A2CA;">Email Us</p>\r\n<div id="contact-info">\r\n<p> customerservice2@skylineint.com.au</p>\r\n</div>', 'contact', 'php_code'),
(4, '1. Fuel Surcharge applies.\r\n2. Above rates are GST exclusive.\r\n3. Rates are based on 200 kg M3\r\n4. Weekly account management fee (GST inclusive) $25.00\r\n5. Dangerous Goods and over-sized freight are charged as per our General Schedule of Rates plus an additional fee. Details available upon request.\r\n\r\n', 'Public Rate Conditions', 'plain_text'),
(5, '<p>&nbsp; &nbsp; Note: You need to be a memeber to view our public rate pages, Please <a href="/user/login?destination=node/50">Login</a> or <a href="/user/register?destination=node/50">Register</a></p>', 'Public Rate(Access denied)', 'filtered_html');
