INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 17, 17, 'und', 0, 'Below are our public rates from Melbourne to other regions. Price are expressed in Australian Dollar (AUD) and Weight are in Kgs', '', 'plain_text'),
('node', 'page', 0, 24, 24, 'und', 0, '<p>Skyline International is an Australia-based transport solution provider, specialising in providing nationwide road feeder service to customers including international airlines so that cargo can reach destinations beyond their gateway ports.&nbsp;</p><p>Our services are fast, reliable and consistent. As a growing company, we are committed to providing dedicated and personalised service and appreciate the value of communication and transparency to our clients.</p>', '', 'filtered_html'),
('node', 'page', 0, 25, 25, 'und', 0, '<p>Skyline International is staffed with industry professionals in all phases of the operation to serve all your logistics needs. We continue to expand our national coverage so to offer better local services for its national and international clients.</p><p>Our commitment to customer satisfaction is second to none. We are focusing on providing a high level of service whilst continuing to deliver cost-effective solutions.</p>', '', 'filtered_html'),
('node', 'article', 0, 28, 28, 'und', 0, 'Please find below the list of our schedules based on Pickup Day. Click on a Pickup Day to find it''s schedule table.', '', 'plain_text'),
('node', 'article', 0, 32, 32, 'und', 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec et pulvinar magna, a luctus nisl. Quisque congue feugiat metus, ac varius nulla. Curabitur leo risus, mattis non ex nec, viverra pretium lorem. Morbi tempor elit ac facilisis ornare. Aliquam erat volutpat. Duis tortor risus, pharetra a sapien ut, sollicitudin elementum risus', '', 'plain_text'),
('node', 'article', 0, 33, 33, 'und', 0, 'Please note transit times are measured on working days ONLY and starts from the day AFTER the freight is collected.', '', 'plain_text'),
('node', 'article', 0, 34, 34, 'und', 0, '<p>Please note transit times are measured on working days ONLY and starts from the day AFTER the freight is collected.</p><p>&nbsp;</p>', '', 'filtered_html'),
('node', 'article', 0, 35, 35, 'und', 0, 'Please note transit times are measured on working days ONLY and starts from the day AFTER the freight is collected.', '', 'plain_text'),
('node', 'article', 0, 36, 36, 'und', 0, 'Please note transit times are measured on working days ONLY and starts from the day AFTER the freight is collected.', '', 'plain_text'),
('node', 'article', 0, 37, 37, 'und', 0, 'Please note transit times are measured on working days ONLY and starts from the day AFTER the freight is collected.', '', 'plain_text'),
('node', 'article', 0, 38, 38, 'und', 0, 'Please note transit times are measured on working days ONLY and starts from the day AFTER the freight is collected.', '', 'plain_text'),
('node', 'article', 0, 39, 39, 'und', 0, 'Please note transit times are measured on working days ONLY and starts from the day AFTER the freight is collected.', '', 'plain_text'),
('node', 'page', 0, 50, 50, 'und', 0, '<p>This page list all our rates from one state or city to another. Please click on a specific region to see the rate from that region to other region. Please <a href="/node/91t">Contact us</a> if you have any question.</p>', '', 'filtered_html'),
